import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import ProductList from './ProductList';
import ProductDetail from './ProductDetail';
import Cart from './Cart';
import FilterSort from './FilterSort';
import Container from '@mui/material/Container';
import Box from '@mui/material/Box';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Badge from '@mui/material/Badge';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import HomeIcon from '@mui/icons-material/Home';
import CssBaseline from '@mui/material/CssBaseline'; // Import CssBaseline
import BackgroundAnimation, { varColor2x, varColor3x, varKenburnsTop, varPanTop } from './components/BackgroundAnimation';


const App = () => {
  const [products, setProducts] = useState([
    { id: 1, name: 'Laptop', price: 1000, category: 'electronics', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSS8a98YcISXlnsbrCTPy8a8AfGj05BtxWR8g&s' },
    { id: 2, name: 'Shirt', price: 50, category: 'fashion', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTtSUyyG8oyiBEebg18TvGzxrVmQdUPQdpgyA&s', },
    { id: 3, name: 'Phone', price: 500, category: 'electronics', image: 'data:image/jpeg;base64,' },
    { id: 4, name: 'Shoes', price: 80, category: 'fashion', image: 'data:image/jpeg;base64,' },
    { id: 5, name: 'Headphones', price: 150, category: 'electronics', image: 'data:image/jpeg;base64,' },
    { id: 6, name: 'Watch', price: 200, category: 'fashion', image: 'data:image/jpeg;base64,' },
    { id: 7, name: 'Tablet', price: 300, category: 'electronics', image: 'data:image/jpeg;base64,' },
    { id: 8, name: 'Jacket', price: 120, category: 'fashion', image: 'data:image/jpeg;base64,' },
    // Add more products here
  ]);
  const [cart, setCart] = useState([]);
  const [filter, setFilter] = useState('');
  const [sort, setSort] = useState('low-to-high');

  const addToCart = (product) => {
    setCart(prevCart => {
      const existingProduct = prevCart.find(item => item.id === product.id);
      if (existingProduct) {
        return prevCart.map(item =>
          item.id === product.id ? { ...item, quantity: item.quantity + 1 } : item
        );
      } else {
        return [...prevCart, { ...product, quantity: 1 }];
      }
    });
  };

  const removeFromCart = (id) => {
    setCart(prevCart => prevCart.filter(item => item.id !== id));
  };

  const updateQuantity = (id, quantity) => {
    setCart(prevCart => prevCart.map(item =>
      item.id === id ? { ...item, quantity } : item
    ));
  };

  const filteredProducts = products.filter(product => filter ? product.category === filter : true);
  const sortedProducts = filteredProducts.sort((a, b) => sort === 'low-to-high' ? a.price - b.price : b.price - a.price);

  return (
    
    <Router>
      <div>
      <CssBaseline />
      {/* You can use different variants based on your preference */}
      <BackgroundAnimation variant={varColor2x} />
      {/* Add more BackgroundAnimation components with different variants */}
    </div>
      <AppBar position="static">
        <Toolbar>
          <IconButton component={Link} to="/" color="inherit">
            <HomeIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            E-Commerce
          </Typography>
          <IconButton component={Link} to="/cart" color="inherit">
            <Badge badgeContent={cart.length} color="secondary">
              <ShoppingCartIcon />
            </Badge>
          </IconButton>
        </Toolbar>
      </AppBar>
      <Container>
        <Box my={4}>
          <FilterSort setFilter={setFilter} setSort={setSort} />
          <Routes>
            <Route path="/" element={<ProductList products={sortedProducts} />} />
            <Route path="/product/:id" element={<ProductDetail products={products} addToCart={addToCart} />} />
            <Route path="/cart" element={<Cart cart={cart} removeFromCart={removeFromCart} updateQuantity={updateQuantity} />} />
          </Routes>
        </Box>
      </Container>
    </Router>
  );
};

export default App;